import React, { useState } from 'react';
import './loginForm.css'

function LoginForm() {
  const [token, setToken] = useState('');

  function handleSubmit(event) {
    event.preventDefault();
    // Send the token to a server or do something else with it here
  }

  return (
	<div className='main-container'>
	 <div className='middle'>
         <div className='return-btn'>
            <button type='button'>Go back</button>
        </div>
		<div className='text-container' >
		<img alt="versitech logo" src="/static/media/versitech.ed4222a3c84377ac8cbb.png" class="chakra-image css-l0hycr"/>
		<p>Check your mail for verification</p>
		</div>
	  </div>
	  <div className='token-container'></div>
    </div>

  );
}

export default LoginForm;
